import post from './Post.css'

function Wall() {
    return (
    <div>
        <div className={post.item}>
            Post1
        </div>
        <div className={post.item}>
            <img src={"https://funik.ru/wp-content/uploads/2019/09/f48cfb0030457662a30d-700x467.jpg"} alt={"img_post"}/>
        </div>
    </div>
    );
}

export default Post;
